export default function Schedule() {
    return (
    <body>
    <h1>Schedule Movies</h1>
    <div className="input-group">
          Movie Title
          <label htmlFor="movieTitle"></label>
          <input
            type="text"
            name="m_title"
            onChange={(event) => {
              setMovie({
                ...movie,
                m_title: event.target.value,
              });
            }}
          />
        </div>

    </body>
)
}
